import React, {useEffect} from 'react';
import AddRoomForm from "../../components/AddRoomForm";
import {useDispatch, useSelector} from "react-redux";
import {useSecureLs} from "../../../Global/UseSecureLs";
import {getAdmin, getBookingRequests, responseBookingRequests} from "../../../../redux/actions/admin.action";

function AddRoom() {
    const dispatch = useDispatch();
    const [adminToken] = useSecureLs("admin_token")
    const onSubmitHandler = (values) => {
        const timer = setTimeout(() => {
            responseBookingRequests(dispatch, adminToken, values)
        }, 2000)
        return () => clearTimeout(timer);
    }

    useEffect(() => {
        document.title = `Booking Requests`
    },[adminToken]);

    return (
        <div className="flex justify-center items-center">
            <AddRoomForm onSubmit={onSubmitHandler}/>
        </div>
    );
};

export default AddRoom;
